function BarFill({value, max, colorFrom, colorTo, height, label}) {
  const pct = Math.min(100, (value/max)*100);
  return (
    <div className="relative" style={{height: height||'16px'}}>
      <div className="absolute inset-0 bg-gray-800 rounded-sm border border-gray-600 overflow-hidden">
        <div className="h-full transition-all duration-300" style={{width:pct+'%', background:'linear-gradient(to right, '+colorFrom+', '+colorTo+')'}} />
      </div>
      {label !== false && <span className="absolute inset-0 flex items-center justify-center text-white font-bold" style={{fontSize:'11px', textShadow:'0 1px 2px #000'}}>{value} / {max}</span>}
    </div>
  );
}
function GoldDisplay({amount}) {
  return <span className="text-yellow-400">{String.fromCodePoint(0x1F4B0)} {amount.toLocaleString()}g</span>;
}
function createAudioEngine(){
  let ctx=null,master=null,started=false;
  function init(){if(ctx)return;try{ctx=new(window.AudioContext||window.webkitAudioContext)();master=ctx.createGain();master.gain.value=0.15;master.connect(ctx.destination);}catch(e){}}
  function osc(type,freq,dur,gain){if(!ctx)return;try{const o=ctx.createOscillator();o.type=type;o.frequency.value=freq;const g=ctx.createGain();g.gain.setValueAtTime(gain,ctx.currentTime);g.gain.exponentialRampToValueAtTime(0.001,ctx.currentTime+dur);o.connect(g);g.connect(master);o.start();o.stop(ctx.currentTime+dur);}catch(e){}}
  function noise(dur,freq,gain){if(!ctx)return;try{const sz=Math.floor(ctx.sampleRate*dur);const buf=ctx.createBuffer(1,sz,ctx.sampleRate);const d=buf.getChannelData(0);for(let i=0;i<sz;i++)d[i]=(Math.random()*2-1)*Math.exp(-i/sz*4);const src=ctx.createBufferSource();src.buffer=buf;const lp=ctx.createBiquadFilter();lp.type='lowpass';lp.frequency.value=freq||2000;const g=ctx.createGain();g.gain.value=gain||0.15;src.connect(lp);lp.connect(g);g.connect(master);src.start();}catch(e){}}
  function startMusic(){if(!ctx||started)return;started=true;try{const pg=ctx.createGain();pg.gain.value=0.06;pg.connect(master);[110,130.81,164.81,220].forEach(f=>{const o=ctx.createOscillator();o.type='sine';o.frequency.value=f;const g=ctx.createGain();g.gain.value=0.15;o.connect(g);g.connect(pg);o.start();});const bo=ctx.createOscillator();bo.type='sine';bo.frequency.value=55;const bg=ctx.createGain();bg.gain.value=0.08;const lfo=ctx.createOscillator();lfo.type='sine';lfo.frequency.value=0.3;const lg=ctx.createGain();lg.gain.value=0.04;lfo.connect(lg);lg.connect(bg.gain);bo.connect(bg);bg.connect(master);bo.start();lfo.start();const mn=[440,523.25,587.33,659.25,783.99,659.25,587.33,523.25,440,392,349.23,392];let mi=0;function nm(){if(!ctx)return;try{osc('triangle',mn[mi%mn.length]*.5,2.5,0.04);mi++;setTimeout(nm,2500+Math.random()*1000);}catch(e){}}setTimeout(nm,1000);const sn=[1318.5,1567.98,1760,1567.98];let si=0;function ns(){if(!ctx)return;try{osc('sine',sn[si%sn.length],4,0.012);si++;setTimeout(ns,4000+Math.random()*3000);}catch(e){}}setTimeout(ns,3000);}catch(e){}}
  function dragonRoar(){if(!ctx)return;try{const sz=Math.floor(ctx.sampleRate*2);const buf=ctx.createBuffer(1,sz,ctx.sampleRate);const d=buf.getChannelData(0);for(let i=0;i<sz;i++){const t=i/ctx.sampleRate;d[i]=(Math.sin(t*60*(1+Math.sin(t*2)*.5))*.4+(Math.random()*2-1)*.3)*Math.exp(-t*.8)*(1+Math.sin(t*8)*.3);}const src=ctx.createBufferSource();src.buffer=buf;const lp=ctx.createBiquadFilter();lp.type='lowpass';lp.frequency.value=400;const g=ctx.createGain();g.gain.value=0.3;src.connect(lp);lp.connect(g);g.connect(master);src.start();}catch(e){}}
  function swordSwing(){osc('sawtooth',600,.12,.08);noise(.08,3000,.06);}
  function hitSound(){noise(.12,1500,.12);osc('square',200,.08,.06);}
  function fireBreath(){noise(.8,800,.15);osc('sawtooth',100,.6,.05);}
  return{init,startMusic,dragonRoar,swordSwing,hitSound,fireBreath};
}

shared_styles:
* { box-sizing: border-box; }
.game-ui { font-family: 'Segoe UI', system-ui, sans-serif; }
@keyframes fadeIn { from { opacity: 0; transform: translateY(10px); } to { opacity: 1; transform: translateY(0); } }
.fade-in { animation: fadeIn 0.5s ease-out; }
@keyframes pulse-border { 0%,100% { border-color: rgba(234,179,8,0.3); } 50% { border-color: rgba(234,179,8,0.8); } }
.pulse-border { animation: pulse-border 2s ease-in-out infinite; }
canvas { display: block; }

