      let nearNpc=null,nearD=999;npcs.forEach(n=>{if(n.dead)return;const d=Math.hypot(n.g.position.x-dragon.position.x,n.g.position.z-dragon.position.z);if(d<nearD&&d<50){nearD=d;nearNpc=n;}});
      if(nearNpc){const adx=nearNpc.g.position.x-dragon.position.x,adz=nearNpc.g.position.z-dragon.position.z;dragon.rotation.y=Math.atan2(-adx,-adz);}
      if(dragonAtkT<=0){dragonAtkT=2.5;fireActive=1;npcs.forEach(n=>{if(n.dead)return;const d=Math.hypot(n.g.position.x-dragon.position.x,n.g.position.z-dragon.position.z);if(d<18){n.hp-=15+Math.floor(Math.random()*15);try{if(audioRef.current)audioRef.current.hitSound();}catch(e){}if(n.hp<=0){n.dead=true;n.deathT=8;n.g.visible=false;}}});try{if(audioRef.current)audioRef.current.fireBreath();}catch(e){}}
