      {const cvD=Math.hypot(player.position.x-caveCX,player.position.z-caveCZ);if(cvD<20){dwVoiceT+=dt;dweller.rotation.y=Math.atan2(player.position.x-caveCX,player.position.z-caveCZ);dwHead.rotation.z=Math.sin(t*.008)*.15;dwEyeL.scale.setScalar(1+Math.sin(t*.01)*.15);dwEyeR.scale.setScalar(1+Math.cos(t*.012)*.15);dwBody2.rotation.z=Math.sin(t*.005)*.05;if(dwVoiceT>5){dwVoiceT=0;dwVoiceIdx=(dwVoiceIdx+1)%dwVoiceLines.length;}if(!dwVoiceSp){const vc=document.createElement('canvas');vc.width=512;vc.height=64;const vt=new THREE.CanvasTexture(vc);dwVoiceSp=new THREE.Sprite(new THREE.SpriteMaterial({map:vt,transparent:true,depthTest:false}));dwVoiceSp.scale.set(6,.8,1);dwVoiceSp._canvas=vc;scene.add(dwVoiceSp);}dwVoiceSp.position.set(caveCX,caveBaseY+4.5,caveCZ);const vc=dwVoiceSp._canvas,vx=vc.getContext('2d');vx.clearRect(0,0,512,64);vx.font='bold 18px Arial';vx.textAlign='center';vx.strokeStyle='#000';vx.lineWidth=4;vx.strokeText(dwVoiceLines[dwVoiceIdx],256,36);vx.fillStyle='#44ff44';vx.fillText(dwVoiceLines[dwVoiceIdx],256,36);dwVoiceSp.material.map.needsUpdate=true;dwVoiceSp.material.opacity=.8+Math.sin(t*.005)*.2;caveGlow.intensity=.5+Math.sin(t*.004)*.4;caveGlow2.intensity=.3+Math.sin(t*.006)*.2;setUi(p=>{if(!p.caveNear||p.caveVoice!==dwVoiceLines[dwVoiceIdx])return{...p,caveNear:true,caveVoice:dwVoiceLines[dwVoiceIdx]};return p;});}else{if(dwVoiceSp){scene.remove(dwVoiceSp);dwVoiceSp.material.dispose();dwVoiceSp.material.map.dispose();dwVoiceSp=null;}dwVoiceT=0;setUi(p=>{if(p.caveNear)return{...p,caveNear:false,caveVoice:''};return p;});}}
      {const ct=(t*.0005)%6.28;chicken.position.x=Math.sin(ct)*3;chicken.position.z=Math.cos(ct)*3;chicken.position.y=getH(chicken.position.x,chicken.position.z)+.15;chicken.rotation.y=ct+Math.PI/2;chHd.rotation.x=Math.sin(t*.01)*.3;chBd.position.y=.4+Math.abs(Math.sin(t*.008))*.02;}
      iceGiants.forEach(ig=>{if(ig.dead){ig.deathT-=dt;if(ig.deathT<=0){ig.dead=false;ig.hp=ig.maxHp;ig.g.visible=true;ig.g.position.set(ig.hx,getH(ig.hx,ig.hz),ig.hz);}return;}ig.tmr-=dt;if(ig.tmr<=0){const a=hsh(Math.floor(t*.001)+Math.abs(ig.hx|0),1)*6.28,d2=hsh(Math.floor(t*.001)+Math.abs(ig.hz|0),2)*ig.wr;ig.tx=ig.hx+Math.cos(a)*d2;ig.tz=ig.hz+Math.sin(a)*d2;ig.tmr=3+hsh(Math.floor(t)+Math.abs(ig.hx|0),3)*4;}const dx=ig.tx-ig.g.position.x,dz=ig.tz-ig.g.position.z,dist=Math.sqrt(dx*dx+dz*dz);if(dist>1){ig.g.position.x+=(dx/dist)*ig.spd*dt;ig.g.position.z+=(dz/dist)*ig.spd*dt;ig.g.rotation.y=Math.atan2(dx,dz);}ig.g.position.y=Math.max(getH(ig.g.position.x,ig.g.position.z),WATER_Y);});
