      critters.forEach(cr=>{cr.tmr-=dt;if(cr.tmr<=0){const a=hsh(Math.floor(t*.0005)+Math.abs(cr.hx|0)+50,1)*6.28,d2=hsh(Math.floor(t*.0005)+Math.abs(cr.hz|0)+50,2)*cr.wr;cr.tx=cr.hx+Math.cos(a)*d2;cr.tz=cr.hz+Math.sin(a)*d2;cr.tmr=cr.type==='rabbit'?1+hsh(Math.floor(t)+Math.abs(cr.hx|0),3)*3:3+hsh(Math.floor(t)+Math.abs(cr.hx|0),3)*6;}const dx=cr.tx-cr.g.position.x,dz=cr.tz-cr.g.position.z,dist=Math.sqrt(dx*dx+dz*dz);if(dist>.5){cr.g.position.x+=(dx/dist)*cr.spd*dt;cr.g.position.z+=(dz/dist)*cr.spd*dt;cr.g.rotation.y=Math.atan2(dx,dz);}cr.g.position.y=Math.max(getH(cr.g.position.x,cr.g.position.z),WATER_Y);});
