    chatFnRef.current=(text)=>{const cv=document.createElement('canvas');cv.width=512;cv.height=64;const cx=cv.getContext('2d');cx.font='bold 20px Arial';cx.textAlign='center';cx.strokeStyle='#000';cx.lineWidth=4;cx.strokeText(text.slice(0,40),256,36);cx.fillStyle='#ffe066';cx.fillText(text.slice(0,40),256,36);const tx=new THREE.CanvasTexture(cv);const sp=new THREE.Sprite(new THREE.SpriteMaterial({map:tx,transparent:true,depthTest:false}));sp.scale.set(5,.6,1);sp.position.set(player.position.x,player.position.y+2.8,player.position.z);scene.add(sp);chatBubbles.push({sp,life:4});};

